import { Link } from 'react-router-dom';

import { ContainerPage, TittlePage } from "../../components/Main";

const Page = () => {
    return (
        <ContainerPage>
            <TittlePage>
                <div className="wc-text">
                    <h3><strong>Principais Eventos</strong></h3>
                </div>
            </TittlePage>
            
            <div id="text-div">
                <div id="filter">
                    <img src="../../../filter.png" alt="Seta" />
                    <label htmlFor="btn-filter">Filtrar</label>
                    <input type="search" id="btn-filter" />
                </div>
            </div>

            <section className="principais-eventos">
                <div className="lista-eventos1">
                    {/* Cards aqui */}
                </div>

                <div className="lista-eventos2">
                    {/* Cards aqui */}
                </div>
            </section>
        </ContainerPage>
    );
}

export default Page;
